import logo from './logo.svg';
import './App.scss';
import { Routes } from 'react-router-dom'
import Layout from './components/Layout'
import {
  BrowserRouter as Router,
  Route
} from 'react-router-dom';

function App() {
  return (
    <Routes>
      <Route path="/" elements={<Layout />} />
    </Routes>
  )
}

export default App
